sys_variable_value.value:
(function execute(inputs, outputs) {
    var gcc = new GoogleCloudComputeUtils();
    gcc.validateInputVariables(inputs, outputs);
    gcc.validateMandatoryVariables(inputs, ['projectid', 'zone', 'name', 'machinetype']);
    gcc.maptoOutputFromInput(inputs, outputs, ['projectid', 'zone']);
    var requestBody = {
        "name": inputs.name,
        "description": inputs.description,
        "machineType": "zones/" + inputs.zone + "/machineTypes/" + inputs.machinetype
    }
    if (inputs.labels.length > 0 && inputs["labels"][0]['key']) {
        var labels = {};
        inputs.labels.forEach(function(label) {
            labels[label['key']] = label['value'];
        })
        requestBody.labels = labels;
    }
    if (inputs.disks.length > 0 && inputs["disks"][0]['name']) {
      var source = "projects/"+inputs.projectid+"/zones/"+inputs.zone+"/disks/";
        var disks = [];
        inputs.disks.forEach(function(disk) {
            disks.push({
                "deviceName": disk['name'],
                "source": source + disk['name'],
                "boot": disk['boot'],
            });
        })
        requestBody.disks = disks;
    }
    if (inputs.networkintefaces.length > 0) {
        var networkInterfaces = [];
        inputs.networkintefaces.forEach(function(networkinteface) {
            var networkURL = "projects/" + inputs.projectid + "/global/networks/default";
            if (networkinteface['newtwork'])
                networkURL = "projects/" + inputs.projectid + "/global/networks/" + networkinteface['newtwork'];
            networkInterfaces.push({
                "network": networkURL
            });
        })
        requestBody.networkInterfaces = networkInterfaces;
    }
    outputs.requestbody = JSON.stringify(requestBody);
})(inputs, outputs);

